import React from 'react';
import '../styles/weekly_best.css';

const WeeklyBest = () => {
    return (
        <div className="weekly-best">
            <h2>Weekly Best</h2>
            <div className="product-list">
                <div className="product-item">
                    <img src="123.png" alt="Product 1" />
                    <p>Product 1</p>
                </div>
                <div className="product-item">
                    <img src="123.png" alt="Product 2" />
                    <p>Product 2</p>
                </div>
                <div className="product-item">
                    <img src="123.png" alt="Product 3" />
                    <p>Product 3</p>
                </div>
                {/* 추가 상품 항목을 여기에 추가할 수 있습니다 */}
            </div>
        </div>
    );
};

export default WeeklyBest;
